function countAndSay(n) {
    let num = n > 1 ? countAndSay(n - 1) : '1';
    if (n === 1) { return num; }
    let i = 0;
    let j = 0;
    let count = 0;
    let newNum = '';
    while (j <= num.length) {
        if (num[i] === num[j]) {
            j++;
            count++;
        } else {
            newNum += count + num[i];
            i = j;
            count = 0;
        }
    }
    return newNum;
}

